import React from "react";
import { Box, Input, OutlinedInput, TextField } from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import logo from "/run/media/ij-singh/My Data/WEB DEVELOPMENT/Full Stack Projects/social-media-app/client/src/img/logo.png";

const LogoSearch = () => {
  return (
    <Box
      display={"flex"}
      sx={{
        position: "relative",
      }}
      alignItems={"center"}

    >
      <img src={logo} alt="logo" />
      <OutlinedInput
        placeholder={"Search"}
        inputProps={{
          style: {
            padding: "10px",
            outline: "none",
            border: "0",
            width: "100%",

          },
        }}
        border={"0px"}
        borderRadius={"20px"}

      />
      <SearchIcon
        sx={{
          position: "absolute",
          right: "0",
          background: "#fca61f",
          color: "#f3f3f3",
          padding: "10px",
          borderRadius: "30px"
        }}
        fontSize={'large'}
        // padding={2}
        color={"primary.main"}
      />
    </Box>
  );
};

export default LogoSearch;
